                s4h2  =  s4**2; s4h3 = s4**3; s4h4 = s4**4; s4h5 = s4**5
                s6h2  =  s6**2; s6h3 = s6**3
                s8h2  =  s8**2
                s10h2 = s10**2

                s2_s4 = s2*s4; s2h2_s4 = s2h2*s4; s2h3_s4 = s2h3*s4; s2h4_s4 = s2h4*s4; s2h5_s4 = s2h5*s4
                s2_s6 = s2*s6

                new_s0 = -0.047619047619047616*s10h2 - s2h2/5. - (2*s2h3)/105. - (2*s2h5)/525. + (127*s2h6)/55125. + (107*s2h8)/275625. + (842*s2h9)/3.472875e6 - (2*s2h2_s4)/35. - (2*s2h4_s4)/175. - (8*s2h5_s4)/3675. - (16*s2h7*s4)/18375. + (254*s2h8*s4)/385875. - s4h2/9. - (20*s2*s4h2)/693. - (82*s2h3*s4h2)/10395. + (29*s2h4*s4h2)/363825. - (4*s2h6*s4h2)/6237. - (6*s4h3)/1001. - (68*s2h2*s4h3)/9009. - (1112*s2h3*s4h3)/315315. - (20*s2*s4h4)/6237. + (29693*s2h2*s4h4)/3.1216185e7 - (2*s4h5)/3003. - (140*s10*s4*s6)/4199. - (10*s2_s4*s6)/143. - (2*s2h3_s4*s6)/143. - (8*s2h4_s4*s6)/3003. - (20*s4h2*s6)/1287. - (4*s2h2*s4h2*s6)/1287. - (232*s2h3*s4h2*s6)/27027. - (10*s2*s4h3*s6)/1287. - s6h2/13. - (14*s2*s6h2)/715. - (404*s2h3*s6h2)/75075. + (s2h4*s6h2)/429. - (28*s4*s6h2)/2431. - (114*s2h2_s4*s6h2)/17017. - (400*s6h3)/138567. - (90*s10*s2*s8)/2261. - (490*s4h2*s8)/21879. - (98*s2h2*s4h2*s8)/21879. - (56*s2_s6*s8)/1105. - (56*s2h3_s6*s8)/5525. - (1008*s4*s6*s8)/46189. - (350*s6h2*s8)/46189. - s8h2/17. - (24*s2*s8h2)/1615. - (36*s4*s8h2)/4199.

